es (DCAS)\",\n            \"attribution_link\" : null,\n            \"contact_email\" : null,\n            \"type\" : \"dataset\",\n            \"updatedAt\" : \"2025-08-18T13:12:55.000Z\",\n            \"createdAt\" : \"2016-06-14T21:12:15.000Z\",\n            \"metadata_updated_at\" : \"2024-05-14T14:26:52.000Z\",\n            \"data_updated_at\" : \"2025-08-18T13:12:55.000Z\",\n            \"page_views\" :\n              {\n                \"page_views_last_week\" : 5990,\n                \"page_views_last_month\" : 26328,\n                \"page_views_total\" : 3069353,\n                \"page_views_last_week_log\" : 12.54858111816513,\n                \"page_views_last_month_log\" : 14.68436510706947,\n                \"page_views_total_log\" : 21.549503616103507\n              },\n            \"columns_name\" :\n              [\n                \"MI\",\n                \"Parent Lgy Credit\",\n                \"Adj. FA\",\n                \"Last Name\",\n                \"First Name\",\n                \"Extension Date\",\n                \"List Title Desc\",\n                \"List Agency Desc\",\n                \"List No\",\n                \"Established Date\",\n                \"Published Date\",\n                \"Sibling Lgy Credit\",\n                \"Residency Credit\",\n                \"List Div Code\",\n                \"List Agency Code\",\n                \"Exam No\",\n                \"Group No\",\n                \"Veteran Credit\",\n                \"List Title Code\",\n                \"Anniversary Date\"\n              ],\n            \"columns_field_name\" :\n              [\n                \"mi\",\n                \"parent_lgy_credit\",\n                \"adj_fa\",\n                \"last_name\",\n                \"first_name\",\n                \"extension_date\",\n                \"list_title_desc\",\n                \"list_agency_desc\",\n                \"list_no\",\n                \"established_date\",\n                \"published_date\",\n                \"sibling_lgy_credit\",\n                \"residency_credit\",\n                \"list_div_code\",\n                \"list_agency_code\",\n                \"exam_no\",\n                \"group_no\",\n                \"veteran_credit\",\n                \"list_title_code\",\n                \"anniversary_date\"\n              ],\n            \"columns_datatype\" :\n              [\n                \"Text\",\n                \"Text\",\n                \"Number\",\n                \"Text\",\n                \"Text\",\n                \"Calendar date\",\n                \"Text\",\n                \"Text\",\n                \"Number\",\n                \"Calendar date\",\n                \"Calendar date\",\n                \"Text\",\n                \"Text\",\n                \"Text\",\n                \"Text\",\n                \"Text\",\n                \"Text\",\n                \"Text\",\n                \"Text\",\n                \"Calendar date\"\n              ],\n            \"columns_description\" :\n              [\n                \"A candidate’s middle initial (MI) as it appears on their application.\\n\",\n                \"A “Parent Legacy credit” is an additional credit given on an exam (10 points) to a candidate who lost a parent (FDNY, NYPD, or a First Responder, during or as a result of 911).\\n\",\n                \"The Adjusted Final Average (“Adj. FA” or “AFA”) is an eligible candidate’s test score in addition to any additional credits granted.\\n\",\n                \"A candidate’s last name as it appears on their application.\\n\",\n                \"A candidate’s first name as it appears on their application.\\n\",\n                \"The date on which a list will be extended beyond its original expiration date.  \\n\",\n                \"A descriptive name that identifies a civil service title. \\n\",\n                \"The name of an appointing Agency.\\n\",\n                \"An eligible candidate’s placement on a given list as of the business day that the data set is populated. \\n\\n\",\n                \"The date on which an eligible list is made available for certification to agencies to consider an eligible candidate for appointment.\\n\",\n                \"The date on which an eligible list is made available for review by the general public and appointing agencies.  \\n\",\n                \"A “Sibling Legacy Credit” is additional credit given on an exam (10 points) to a candidate who lost a sibling (FDNY, NYPD, or a First Responder, during or as a result of 911).\\n\",\n                \"An additional credit given on an exam to a candidate who maintains a continuous period of residency in New York City as described in the Notice of Examination for a specific title.     \\n\",\n                \"The promotional division codes/descriptions within the New York City Transit Authority only.\\n\",\n                \"A three (3) digit number used to identify an agency (For Promotion List Only).\\n\",\n                \"A four (4) digit number that identifies a civil service examination. \\n\\n\",\n                \"Represents the certification order for a list. (e.g. – eligible candidates on a list with a 01 group number may be considered for appointment before an eligible candidate on primary list with a 00 group number).\\n\",\n                \"An additional credit given to a Veteran (5 points) or disabled veteran (10 points) when s/he accepts a permanent position from an eligible list. \\n\",\n                \"A five (5) digit number that corresponds to and represents a civil service title.\\n\",\n                \"The date on which an eligible list is scheduled to expire.      \\n\"\n              ],\n            \"columns_format\" :\n              [\n                { \"displayStyle\" : \"plain\", \"align\" : \"left\" },\n                { \"displayStyle\" : \"plain\", \"align\" : \"left\" },\n                {\n                  \"precisionStyle\" : \"standard\",\n         